advancedOptions:
{
    chart: {
        type: 'multiBarChart',
        margin: {
            top: 20, 
            right: 20, 
            bottom: 40,
            left: 55
        },
        x: function(d){ return d.x; },
        y: function(d){ return d.y; },
        stacked: true,
        color: d3.scale.category10().range(),
        xAxis: {
            axisLabel: 'Time (ms)' 
        },
        yAxis: {
            axisLabel: 'Voltage (v)',
            tickFormat: function(d) {
                return d3.format('.02f')(d);
            },
            axisLabelDistance: -10
        }
    }
}

